### Summary of Core Topics and Concepts

#### JavaScript
1. **DOM Manipulation**
   - Accessing elements using `document.getElementById` and `document.getElementsByClassName`.
   - Example: `document.getElementById("id1")` and `document.getElementsByClassName("class1")[0]`.

2. **Lexical Scope and Closures**
   - Understanding how variable names are resolved in nested functions.
   - Inner functions have access to outer function variables.

3. **`<noscript>` Tag**
   - Provides alternate content for browsers that do not support or have disabled JavaScript.

4. **Classes and Static Methods**
   - Creating classes and using static methods.
   - Example:
     ```javascript
     class Person {
         constructor(name) {
             this.name = name;
             this.age = 23;
         }
         static fromJson(obj) {
             let new_obj = new Person(obj.name);
             new_obj.sound = obj.sound;
             return new_obj;
         }
     }
     ```

5. **Arrow Functions and `this` Context**
   - Understanding the behavior of `this` in arrow functions and regular functions.
   - Example:
     ```javascript
     const obj1 = {
       x: 10,
       func: function() {
         console.log(this.x)
       }
     }
     const obj2 = {
       x: 20,
       func: () => {
         function abc() {
           console.log(x, "and", this.x)
           obj1.func.call(this)
         }
         abc()
       }
     }
     ```

6. **Rest Parameters and Spread Operator**
   - Using rest parameters to handle variable numbers of arguments.
   - Example:
     ```javascript
     function doSomething(n, ...params) {
       return params.map((x) => x ** n).sort();
     }
     ```

7. **Object Manipulation**
   - Using `Object.entries` and `forEach` to manipulate objects.
   - Example:
     ```javascript
     function coolerPlace({...obj}) {
         let tmp = 0;
         let cty = null;
         Object.entries(obj).forEach(([city, temp]) => {
             if (temp > tmp) {
                 tmp = temp;
                 cty = city;
             }
         });
         return cty;
     }
     ```

8. **Prototypal Inheritance**
   - Understanding how properties and methods are inherited through the prototype chain.
   - Example:
     ```javascript
     const address1 = {
         state: 'Tamil Nadu',
         city: 'Chennai',
         place: 'IIT Madras',
         getAddress() {
             return `State: ${this.state}, city: ${this.city}, place: ${this.place}`;
         }
     }
     const address3 = {
         place: 'Taramani',
         __proto__: address1,
     }
     ```

9. **Lexical Scoping and Block Scoping**
   - Understanding how `let` and `const` work within blocks.
   - Example:
     ```javascript
     let x = 1;
     let y = 2;
     {
         let x = 4;
         let y = 5;
         {
             function outer() {
                 function inner() {
                     return x + y;
                 }
                 return inner;
             }
             console.log(outer()());
         }
     }
     ```

10. **Binary Search Algorithm**
    - Implementing binary search to find elements in a sorted array.
    - Example:
      ```javascript
      function do_something(arr, val) {
          var i1 = 0;
          var i2 = arr.length;
          while (i2 > i1) {
              var i3 = Math.floor((i1 + i2) / 2);
              if (val > arr[i3]) {
                  i1 = i3 + 1;
              }
              else if (val < arr[i3]) {
                  i2 = i3;
              }
              else {
                  return true;
              }
          }
          return false;
      }
      ```

#### Vue.js
1. **Vue Instance and Data Binding**
   - Creating Vue instances and binding data to the DOM.
   - Example:
     ```javascript
     const a = new Vue({
       el: '#app',
       data: {
         items: [
           { id: 1, name: 'App Dev I Theory' },
           { id: 2, name: 'App Dev I Project' },
           { id: 3, name: 'App Dev II Theory' },
           { id: 4, name: 'App Dev II Project' }
         ]
       }
     });
     ```

2. **v-for Directive**
   - Using `v-for` to render lists.
   - Example:
     ```html
     <ol>
       <li v-for="item in items" :key="item.id">{{ item.name }}</li>
     </ol>
     ```

3. **Components and Props**
   - Creating and using Vue components with props.
   - Example:
     ```javascript
     Vue.component('blog-post', {
       props: {
         postTitle: String,
         postContent: String
       },
       template: `
         <div>
           <h3>{{ postTitle }}</h3>
           <p>{{ postContent }}</p>
         </div>
       `
     });
     ```

4. **Computed Properties**
   - Using computed properties to dynamically calculate values.
   - Example:
     ```javascript
     computed: {
       minDistance() {
         let minDist = Infinity;
         let city = null;
         this.allCoordinates.forEach((cord) => {
           let d = this.calculateDistance(cord.coordinate, this.userCoordinate);
           if (d < minDist) {
             minDist = d;
             city = cord.name;
           }
         });
         return city;
       },
     }
     ```

5. **Watchers**
   - Using watchers to react to data changes.
   - Example:
     ```javascript
     watch: {
       num(num1, num2) {
         if (num1 === '') {
           return;
         }
         this.prev = this.current;
         this.current = Number(num1);
         this.current > this.prev ? (this.lucky = true) : (this.lucky = false);
       }
     }
     ```

6. **Custom Events**
   - Emitting and handling custom events.
   - Example:
     ```javascript
     const Sender = {
       template: '<div> Message: <input type="text" v-model="message"></input> </div>',
       data() {
         return {
           message: null,
         }
       },
       watch: {
         message(msg) {
           this.$emit('newmsg', this.message);
         },
       }
     }
     ```

